// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./quickint.sol";

interface CarInterface {
    function getCapOfCarById(uint _id) external view returns(uint); // returns the cap of the given id's car. 
    function setCarCrew(uint _id) external; // Setter! -- Modifies the "inSquad/inCrew" of the given id in car contract.
    function getCrewStatus(uint _id) external view returns(bool);   // returns bool of "inSquad" of the given id's car.
    function ownerOfId(uint _id, address _add) external view returns(bool); // compares in mapping if the given id & address go along.
}

interface ZombieInterface {
    function getStr(uint _id) external view returns(uint);  // returns the strength of the given id's zombie.
    function verifyIds(uint _id, address _add) external view returns(bool); // Compares _id and address given in mapping from zmb contract.
    function setCrew(uint _id) external; // Setter! -- Midifies the "inSquad" of the given id in zmb contract.
    function checkIfInCrew(uint _id) external view returns(bool); // Returns bool of "inSquad" of the given id's zombie.
}

interface Game {

}

contract Combine2 is Ownable, ERC721 {

    constructor(string memory _name, string memory _symbol)
         ERC721(_name, _symbol) {} 

    // Making migration Functions local:  -----

    function verifyCarOwner(uint _id, address _add) internal view returns(bool) { // Returns bool if msg.sender is Owner of Id
        return car.ownerOfId(_id, _add);
    }

    function carCrewStatus(uint _id) internal view returns(bool) { // Returns car struct data "inCrew"
        return car.getCrewStatus(_id);
    }

    function checkZmbCrew(uint _id) internal view returns(bool) { // Returns zmb struct data "InCrew"
        return zmb.checkIfInCrew(_id);
    }

    function getCarCap(uint _id) internal view returns(uint){ // Returns car struct data "cap"
        uint x = car.getCapOfCarById(_id);
        return x;
    } 

    function getZmbStr(uint _id) internal view returns(uint) { // Gets the str of zombie by id.
        return zmb.getStr(_id);
    }

    function t(uint _id, address x) internal view returns(bool) { // idk why i did this like i did
        return zmb.verifyIds(_id, x);
    }

    function verifyYourZmb(uint _id, address z) public view returns(bool){  // returns true if the id is the owner.
        return t(_id, z);
    }

    function ZmbCrewTrue(uint _id) internal {  // Sets the zombie Struct "crew" to true.
        zmb.setCrew(_id);
    }

    function CarCrewTrue(uint _id) internal { // Sets the car Struct "crew" to true.
        car.setCarCrew(_id);
    }

    //-----------------------------------

    struct Squad {
        uint zombieId0;
        uint zombieId1;
        uint zombieId2;
        uint zombieId3;
        uint zombieId4;
        uint daily;
        uint carId;
        uint strength;
        uint cap;
        bool valid;
    } 

    // Ids-
    function getSquadIds() public view returns(uint[] memory) {
        uint y = 0;
        uint[] memory fetcher = new uint[](howMany[msg.sender]);
        for(uint i = 0; i < squads.length; i++) {
            require(idOwner[i] == msg.sender);
            fetcher[y] = i;
        }
        return fetcher;
    }
    // Squad strength
    function getSquadStrength(uint _id) public view returns(uint) {
        return squads[_id].strength;
    }
    
    // Squad "daily" ---> block.timestamp in case you have attacked alr.
    function getSquadDaily(uint _id) public view returns(uint){ // Returns amount of seconds until attack again.
        require(block.timestamp <= squads[_id].daily, "You are clear to attack");
        return squads[_id].daily - block.timestamp;
    }

    // Single Array:
    Squad[] public squads;  

    // Mappings
    mapping(uint => address) public idOwner;
    mapping(address => uint) public howMany;


    //Internal combination logic.
    uint counter = 0;
    function _combine2(uint _carId, uint _id0, uint _id1) internal { // make it later payable
    require(getCarCap(_carId) >= 2, "Your cars capacity is to low."); // Checks struct data "cap"- uint
    address user = msg.sender;
    require(verifyCarOwner(_carId, user), "Not your car"); // Checks if msg.sender is Owner of Id.
    require(carCrewStatus(_carId) == false, "Your car is in a crew alr."); // Checks if car is in Crew alr-- checks struct data "inCrew"-bool
    require(verifyYourZmb(_id0, user) == true, "Not Your zombie");  // Checks is msg.sender is Owner
    require(checkZmbCrew(_id0) == false, "Your Zombie is already In Crew"); // Checks struct data "inCrew" - bool
    require(verifyYourZmb(_id1, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id1) == false, "Your Zombie is already In Crew");// checks struct data "inCrew" -bool
    uint x = getZmbStr(_id0); // gets struct data "str"
    uint p = getZmbStr(_id1); // gets struct data "str"
    uint q = x + p;
    Squad memory newSquad = Squad(_id0, _id1, 9999, 9999, 9999, block.timestamp, _carId, q, 2, true);
    squads.push(newSquad);
    pop(msg.sender, counter);
    idOwner[counter] = msg.sender;
    howMany[msg.sender]++;
    ZmbCrewTrue(_id0); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id1); // modifies struct data in ZmbContract - "inCrew"-bool
    CarCrewTrue(_carId); // modifies struct data in CarContract - "inCrew"-bool
    counter++;
    }

    function _combine3(uint _carId, uint _id0, uint _id1, uint _id2) internal { // make it later payable
    require(getCarCap(_carId) >= 3, "Your cars capacity is to low."); // Checks struct data "cap"- uint
    address user = msg.sender;
    require(verifyCarOwner(_carId, user), "Not your car");
    require(carCrewStatus(_carId) == false, "Your car is in a crew alr."); // Checks if car is in Crew alr-- checks struct data "inCrew"-bool
    require(verifyYourZmb(_id0, user) == true, "Not Your zombie");  // Checks is msg.sender is Owner
    require(checkZmbCrew(_id0) == false, "Your Zombie is already In Crew"); // Checks struct data "inCrew" - bool
    require(verifyYourZmb(_id1, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id1) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id2, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id2) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    uint x = getZmbStr(_id0); // gets struct data "str"
    uint p = getZmbStr(_id1); // gets struct data "str"
    uint r = getZmbStr(_id2); // gets struct data "str"
    uint q = x + p + r;
    Squad memory newSquad = Squad(_id0, _id1, _id2, 9999, 9999, block.timestamp, _carId, q, 3, true);
    squads.push(newSquad);
    pop(msg.sender, counter);
    idOwner[counter] = msg.sender;
    howMany[msg.sender]++;
    ZmbCrewTrue(_id0); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id1); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id2); // modifies struct data in ZmbContract - "inCrew"-bool
    CarCrewTrue(_carId); // modifies struct data in CarContract - "inCrew"-bool
    counter++;
    }

    function _combine4(uint _carId, uint _id0, uint _id1, uint _id2, uint _id3) internal { // make it later payable
    require(getCarCap(_carId) >= 4, "Your cars capacity is to low."); // Checks struct data "cap"- uint
    address user = msg.sender;
    require(verifyCarOwner(_carId, user), "Not your car");
    require(carCrewStatus(_carId) == false, "Your car is in a crew alr."); // Checks if car is in Crew alr-- checks struct data "inCrew"-bool
    require(verifyYourZmb(_id0, user) == true, "Not Your zombie");  // Checks is msg.sender is Owner
    require(checkZmbCrew(_id0) == false, "Your Zombie is already In Crew"); // Checks struct data "inCrew" - bool
    require(verifyYourZmb(_id1, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id1) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id2, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id2) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id3, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id3) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    uint x = getZmbStr(_id0); // gets struct data "str"
    uint p = getZmbStr(_id1); // gets struct data "str"
    uint r = getZmbStr(_id2); // gets struct data "str"
    uint g = getZmbStr(_id3); // gets struct data "str"
    uint q = x + p + r + g;
    Squad memory newSquad = Squad(_id0, _id1, _id2, _id3, 9999, block.timestamp, _carId, q, 4, true);
    squads.push(newSquad);
    pop(msg.sender, counter);
    idOwner[counter] = msg.sender;
    howMany[msg.sender]++;
    ZmbCrewTrue(_id0); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id1); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id2); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id3); // modifies struct data in ZmbContract - "inCrew"-bool
    CarCrewTrue(_carId); // modifies struct data in CarContract - "inCrew"-bool
    counter++;
    }

    function _combine5(uint _carId, uint _id0, uint _id1, uint _id2, uint _id3, uint _id4) internal { // make it later payable
    require(getCarCap(_carId) >= 5, "Your cars capacity is to low."); // Checks struct data "cap"- uint
    address user = msg.sender;
    require(verifyCarOwner(_carId, user), "Not your car");
    require(carCrewStatus(_carId) == false, "Your car is in a crew alr."); // Checks if car is in Crew alr-- checks struct data "inCrew"-bool
    require(verifyYourZmb(_id0, user) == true, "Not Your zombie");  // Checks is msg.sender is Owner
    require(checkZmbCrew(_id0) == false, "Your Zombie is already In Crew"); // Checks struct data "inCrew" - bool
    require(verifyYourZmb(_id1, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id1) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id2, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id2) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id3, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id3) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    require(verifyYourZmb(_id4, user) == true, "u messed up");  // Checks if msg.seder is owner
    require(checkZmbCrew(_id4) == false, "Your Zombie is already In Crew"); // checks struct data "inCrew" -bool
    uint x = getZmbStr(_id0); // gets struct data "str"
    uint p = getZmbStr(_id1); // gets struct data "str"
    uint r = getZmbStr(_id2); // gets struct data "str"
    uint g = getZmbStr(_id3); // gets struct data "str"
    uint e = getZmbStr(_id4); // gets struct data "str"
    uint q = x + p + r + g + e;
    Squad memory newSquad = Squad(_id0, _id1, _id2, _id3, _id4, block.timestamp, _carId, q, 5, true);
    squads.push(newSquad);
    pop(msg.sender, counter);
    idOwner[counter] = msg.sender;
    howMany[msg.sender]++;
    ZmbCrewTrue(_id0); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id1); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id2); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id3); // modifies struct data in ZmbContract - "inCrew"-bool
    ZmbCrewTrue(_id4); // modifies struct data in ZmbContract - "inCrew"-bool
    CarCrewTrue(_carId); // modifies struct data in CarContract - "inCrew"-bool
    counter++;
    }

    function combineCap2(uint _carId, uint _id0, uint _id1) public { // add fee later.
        _combine2(_carId, _id0, _id1);
    }

    function combineCap3(uint _carId, uint _id0, uint _id1, uint _id2) public {
        _combine3(_carId, _id0, _id1, _id2);
    }

    function combineCap4(uint _carId, uint _id0, uint _id1, uint _id2, uint _id3) public {
        _combine4(_carId, _id0, _id1, _id2, _id3);
    }

    function combineCap5(uint _carId, uint _id0, uint _id1, uint _id2, uint _id3, uint _id4) public {
        _combine5(_carId, _id0, _id1, _id2, _id3, _id4);
    }

    // Export functions

    function confirmOwnerById(uint _id, address _add) external view returns(bool) {  // getter for ownership
        return (idOwner[_id] == _add);
    }
    function getSquadValidity(uint _id) external view returns (bool) { // returns "valid" from struct to prove is squad is active.
        return squads[_id].valid; // if valid true => active -- if false its broken.
    }

    function getSquadStr(uint _id) external view returns(uint) { // returns structs specific ids str
       return squads[_id].strength;
    }
    function getTimeOnSquad(uint _id) external view returns(uint) { // Returns squad structs timeblockstamp. So you only attck once.
        return squads[_id].daily;
    }
    function setTimeOnSquad(uint _id) external onlyGameContract { // important function that CHANGES struct 
        squads[_id].daily = block.timestamp + 1 days;
    }


    // Setting Interfaces
    ZombieInterface zmb;
    CarInterface car;
    Game game;
    address gameContract;
    address zombieContract;
    address carContract;

    modifier onlyGameContract() {
        require(msg.sender == gameContract);
        _;
    }
    // After deployment -- need to set these 3 addresses !!!!!! ------------------------
    function setGame(address _add) public onlyOwner {
        game = Game(_add);
        gameContract = _add;
    }

    function setZmb(address _add) public onlyOwner {
        zmb = ZombieInterface(_add);
        zombieContract = _add;
    } 

    function setCar(address _add) public onlyOwner {
        car = CarInterface(_add);
        carContract = _add;
    }   

    // security Code
    function pop(address to, uint256 tokenId) internal virtual {
            _mint(to, tokenId);
            require(_checkOnERC721Received(address(0), to, tokenId), "not today");
        }

        function isContract(address account) internal view returns(bool) {
            return account.code.length > 0;
        }

        function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId
    ) private returns (bool) {
        if (isContract(to)) {
            try IERC721Receiverr(to).onERC721Received(_msgSender(), from, tokenId) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }
}

